import React from 'react'

function Card(props) {
    const getCard = props.card
    return (  
        <div>
            {getCard.map((items)=>{
            <div>
                <p style="">{items.name}</p>
                <img src={items.avatar}/>
                <p>{items.gianguoilon}</p>
            </div>
        }) 
        }
        </div>
    )
}

export default Card
